import React from 'react'

import Video from '../video/video.component'

const CollectionDetails = ({items}) => {
    return (
        <div>
            {
                items.map(item => (
                <>
                    <h1>{item.name}</h1>
                    <img src={item.imageUrl} alt=""/>
                    <Video url = {item.videoUrl}/>
                </>
                ))
            }
        </div>
    )
}

export default CollectionDetails
